/* Reset */

*, *::before, *::after { box-sizing: border-box }
body { min-height: 100vh; min-height: 100svh; }
body, h1, h2, h3, h4, p, figure, blockquote, dl, dd { margin: 0; }
img, picture { max-width: 100%; display: block }
input, button, textarea, select { font: inherit }

/* Measure and leading setup */

:root
{ font-size: 93.75%; /* 1rem is 15px */

  --leading_ratio_m: 1.5; /* leading / font size */
  --leading_m: calc(var(--leading_ratio_m) * 1rem);

  --leading_ratio_xs: calc(0.7 * var(--leading_ratio_m));
  --leading_ratio_s: calc(0.8 * var(--leading_ratio_m));
  --leading_ratio_l: calc(1.2 * var(--leading_ratio_m));
  --leading_ratio_xl: calc(1.5 * var(--leading_ratio_m));

  --measure_m: 64ch;
  --measure_xs: calc(0.25 * var(--measure_m));
  --measure_s: calc(0.5 * var(--measure_m));
  --measure_l: calc(1.5 * var(--measure_m));
  --measure_xl: calc(2.0 * var(--measure_m)); }

body { line-height: var(--leading_ratio_m); }

* { max-inline-size: none }
p { max-inline-size: var(--measure_m) }

/* Type and space scale */

:root
{
  --t-3: 0.485;
  --t-2: 0.618;
  --t-1: 0.786;
  --t0: 1;
  --t1: 1.616;
  --t2: 3.232;
  --t3: 4.848;

  --sp_xxs: calc(0.485 * var(--leading_m));
  --sp_xs: calc(0.618 * var(--leading_m));
  --sp_s: calc(0.786 * var(--leading_m));
  --sp_m: var(--leading_m);
  --sp_l: calc(1.616 * var(--leading_m));
  --sp_xl: calc(3.232 * var(--leading_m));
  --sp_xxl: calc(4.848 * var(--leading_m));
  --sp_xxxl: calc(6.853 * var(--leading_m));
  --sp_xxxxl: calc(11.089 * var(--leading_m)); }

:root
{ font-synthesis: none;
  -webkit-text-size-adjust: none;

  --font_headings: "Inter";
  --font_body: "Inter";
  --font_body_features: "ss01";
  --font_mono: monospace;
  --font_mono_ratio: 1; /* mono size / font body size */

  --font_xxs: calc(var(--t-3) * 1rem);
  --font_xs: calc(var(--t-2) * 1rem);
  --font_s: calc(var(--t-1) * 1rem);
  --font_m: 1rem;
  --font_l: calc(var(--t1) * 1rem);
  --font_xl: calc(var(--t2) * 1rem);
  --font_xxl: calc(var(--t3) * 1rem);

  --font_numeric_default: normal;
  --font_numeric_tabular: slashed-zero tabular-nums; }

body
{ font-family: var(--font_body); font-size: 1rem; font-weight: 400;
  font-feature-settings: var(--font_body_features);
  font-variant-numeric: var(--font_numeric_default); }

/* FIXME review this, tracking vs font-stretch. */

.font_stretch_xxs { letter-spacing: -0.1rem } /* { font-stretch: 50% } */
.font_stretch_xs { letter-spacing: -0.05rem } /* { font-stretch: 75% } */
.font_stretch_s { letter-spacing: -0.01rem } /* { font-stretch: 87.5% } */
.font_stretch_m { letter-spacing: normal; } /* { font-stretch: 100%; } */
.font_stretch_l { letter-spacing: 0.01rem; } /* { font-stretch: 112.5% } */
.font_stretch_xl { letter-spacing: 0.05rem; } /* { font-stretch: 125% } */
.font_stretch_xxl { letter-spacing: 0.1rem; } /* { font-stretch: 150% } */

/* Text */

.text_flow > * + * { margin-block-start: var(--sp_s); }
.text_flow > * + h2 { margin-block-start: var(--sp_l); }

/* Inlines */

em { font-style: oblique }
b, strong { font-weight: 700 }
small { font-size: var(--font_small) }
sup { font-feature-settings: "sups";
      font-size: inherit; vertical-align: baseline }

sub { font-feature-settings: "subs";
      font-size: inherit; vertical-align: baseline }

code { font-family: var(--font_mono);
       font-size: calc(1em * var(--font_mono_ratio)); }

a { text-decoration: underline;
    text-decoration-thickness: 0.04em;
    text-decoration-skip-ink: all;
    text-underline-offset: 3px; }

/* Headings */

h1, h2, h3, h4, h5, h6 { font-family: var(--font_headings); font-weight: 700}
h1 { font-size: var(--font_xxl) }
h2 { font-size: var(--font_l);
     font-weight: 200; text-transform: uppercase; font-feature-settings: "cpsp"}

/* Block layouts */

.stack
{ --stack_gap: var(--sp_m);
  display: flex; flex-direction: column; justify-content: flex-start;
  gap: var(--stack_gap); }

.box
{ --box_pad: var(--sp_m); --box_border: 0;
  padding: var(--box_pad); border: var(--box_border) solid; }

.center /* on the inline axis */
{ --center_max_size: var(--measure_m); --center_pad: 0; --center_align: normal;
  display: flex; flex-direction: column; align-items: var(--center_align);
  box-sizing: content-box;
  max-inline-size: var(--center_max_size);
  padding-inline-start: var(--center_pad);
  padding-inline-end: var(--center_pad);
  margin-inline: auto; }

.cluster
{ --cluster_justify: flex-start; --cluster_align: center;
  --cluster_gap: var(--sp_m);
  display: flex; flex-wrap: wrap;
  align-items: var(--cluster_align); justify-content: var(--cluster_justify);
  gap: var(--cluster_gap); }


.sidebar
{ --sidebar_gap: var(--sp_m); --sidebar_bar_size: auto;
  --sidebar_min_content: 50%;
  display: flex; flex-wrap: wrap;
  gap: var(--sidebar_gap); }

.sidebar.start > :first-child, .sidebar.end > :last-child
{ flex-basis: var(--sidebar_bar_size); flex-grow: 1; }

.sidebar.start > :last-child, .sidebar.end > :first-child
{ flex-basis: 0; flex-grow: 999;
  min-inline-size: var(--sidebar_min_content); }


.switcher
{ --switcher_gap: var(--sp_m); --switcher_at_size: var(--measure_m);
  display: flex; flex-wrap: wrap; gap: var(--switcher_gap); }

.switcher > *
{ flex-grow: 1; flex-basis: calc((var(--switcher_at_size) - 100%) * 999) }

.switcher > :nth-last-child(n + 5),
.switcher > :nth-last-child(n + 5) ~ * { flex-basis: 100% }


.cover > .central { margin-block: auto; }
.cover
{ --cover_gap: var(--sp_m); --cover_min_size: 100vh;
  display: flex; flex-direction: column; gap: var(--cover_gap);
  min-block-size: var(--cover_min_size); }


.grid
{ --grid_gap: var(--sp_m); --grid_min: var(--measure_xs);
  display: grid;
  grid-gap: var(--grid_gap);
  grid-template-columns:
    repeat(auto-fit, minmax(min(var(--grid_min), 100%), 1fr)); }


.frame
{ --frame_ratio_num: 16; --frame_ratio_den: 9;
  display: flex; justify-content: center; align-items: center;
  aspect-ratio:  var(--frame_ratio_num) / var(--frame_ratio_den);
  overflow: hidden; }

.frame > img, .frame > video
{ inline-size: 100%; block-size: 100%; object-fit: cover }


.reel
{ --reel_item_size: auto;
  --reel_gap: var(--sp_m);
  --reel_scrollbar_size: var(--sp_xxs);
  --reel_scrollbar_visible: auto; /* use scroll to make it always visible */
  --reel_track_color: #fff;
  --reel_thumb_color: #000;
  display: flex;
  overflow-x: var(--reel_scrollbar_visible); overflow-y: hidden;
  scrollbar-color: var(--reel_thumb_color) var(--reel_track_color);
  gap: var(--reel_gap); }

.reel::-webkit-scrollbar-thumb { background-color: var(--reel_thumb_color); }
.reel::-webkit-scrollbar
{ block-size: var(--reel_scrollbar_size); border-top: 1px solid; }

.reel > * { flex: 0 0 var(--reel_item_size); }
.reel > img { block-size: 100%; flex-basis: auto; width: auto; }

.imposter
{ --imposter_position: absolute;
  --imposter_pad: var(--sp_m);
  position: var(--imposter_position);
  inset-block-start: 50%;
  inset-inline-start: 50%;
  transform: translate(-50%, -50%);
}

.imposter.contained {
  overflow: auto;
  max-inline-size: calc(100% - (var(--imposter_pad) * 2));
  max-block-size: calc(100% - (var(--imposter_pad) * 2));
}

/* Icons */

.icon { width: 0.75em; width: 1cap; height: 0.75em; height: 1cap}
.with_icon { --icon_gap: 0.25em; display: inline-flex; align-items: baseline; }
.with_icon .icon { margin-inline-end: var(--icon_gap) }

:root
{
  --r_track: #e9e9ed;
  --r_track-border: #BBB;
  --r_track-hover: #e5e5e5;
  --r_thumb-active: #3793ff;
  --r_thumb-hover: #005cc8;
  --r_thumb: #0075ff;

  --b_bg: #eee;
  --b_border: #777;
  --b_disabled-border: #AAA;
  --b_active: #ccc;
  --b_active-border: #666;

  --bg: white;

  --font_numeric_tabular: /* slashed-zero */ tabular-nums; }


body { font-variant-numeric:var(--font_numeric_tabular)}
body { max-inline-size: calc(1.75 * var(--measure_m));
       margin: auto; }

canvas { box-sizing: content-box; cursor: pointer; }
.scale { position: relative; box-sizing:content-box; }
.scale::before
{ content: ''; position: absolute; top: 0; left: 0;
  border-left: 1px solid black; border-right: 1px solid black;
  height: 45%; width: 100%; }

footer { color: #777 }

/* Table */

.datatable
{ --datatable_rows: 10;
  --datatable_hover: #f5f5f5;
  --datatable_sep: #efefef;
  --datatable_cell_pad: 0.4em;
  --datatable_data_block_pad: 0.25em;
  width: 100%;
  border: 1px solid var(--datatable_sep); border-radius: 4px;
  max-height:
    calc(var(--datatable_rows) * (var(--leading_ratio_m) * 1em +
                                  2 * var(--datatable_data_block_pad) + 1px));
  overflow: auto }


table { width: 100%; margin: 0;
        border-collapse: separate; border-spacing: 0; white-space: nowrap; }

th { color: #333; font-weight: 600; text-align:left; position: sticky; top: 0;
     background: var(--bg); padding: var(--datatable_cell_pad);
     z-index: 3; }
td { padding-inline: var(--datatable_cell_pad);
     padding-block: var(--datatable_data_block_pad);
     z-index: 1; }

th > a { color: inherit; text-decoration:none; }
th:hover > a { text-decoration: underline;
               text-decoration-thickness: 0.04em;
               text-decoration-skip-ink: all;
               text-underline-offset: 3px; }

td, th { border: 0px solid var(--datatable_sep) }
td, th { border-inline-end-width: 1px; border-block-end-width: 1px; }
td:last-child, th:last-child { border-inline-end-width: 0px }
tbody tr:last-child td { border-block-end-width: 0px }
th:first-child, td:first-child
{ background: var(--bg); position: sticky; left: 0; }
th:first-child { z-index: 4; }
td:first-child { color: #777; z-index: 2 }
tbody tr:hover > * , .datatable .selected > *
{ background: var(--datatable_hover); }

tr:hover { cursor: pointer }

/* Range */

input[type="range"] { appearance: none; cursor:pointer; width:14ch; }
input[type="range"]:disabled { cursor:auto; opacity: 0.5; }
input[type="range"]:focus { outline: none }

input[type="range"]::-webkit-slider-runnable-track
{ height: 1rem; background: var(--r_track);
  border: solid 1px var(--r_track-border); border-radius: 2px; }

input[type="range"]::-webkit-slider-thumb
{ appearance: none; height: 1rem; width: 0.5rem; background: var(--r_thumb);
  margin-top:-1px; }

input[type="range"]:hover::-webkit-slider-runnable-track
{ background: var(--r_track-hover); }

input[type="range"]:hover::-webkit-slider-thumb
{ background: var(--r_thumb-hover); }

input[type="range"]:active::-webkit-slider-thumb
{ background: var(--r_thumb-active); }

input[type="range"]:focus::-webkit-slider-thumb
{ outline: 3px solid var(--r_thumb-active); outline-offset: 0.125rem; }


input[type="range"]::-moz-range-track
{ height: 1rem; background: var(--r_track);
  border: solid 1px var(--r_track-border); border-radius: 2px; }

input[type="range"]::-moz-range-thumb
{ appearance: none; height: 1rem; width: 0.5rem; background: var(--r_thumb);
  border: 1px solid var(--r_thumb); border-radius: 0; /* Still added by FF */
  margin-top:-1px; }

input[type="range"]:hover::-moz-range-track
{ background: var(--r_track-hover); }

input[type="range"]:hover::-moz-range-thumb
{ background: var(--r_thumb-hover); }

input[type="range"]:active::-moz-range-thumb
{ background: var(--r_thumb-active); }

input[type="range"]:focus::-moz-range-thumb
{ outline: 3px solid var(--r_thumb-active); outline-offset: 0.125rem; }

/* Button */

button
{ appearance: none;
  display: inline-flex; align-items: center;
  padding: 0.25em 0.5em;
  background-color: var(--b_bg);
  border: solid 1px var(--b_border);
  border-radius: 3px;
  cursor:pointer; }

button:disabled, button:hover:active:disabled
{ background-color: var(--b_bg);
  border-color:var(--b_disabled-border); cursor: auto}

button:hover:active
{ background-color:var(--b_active); border-color:var(--b_active-border); }

button .icon { margin-inline-end: 0.25em; }

label {   display: inline-flex; align-items: center; }
label .icon { margin-inline-end: 0.5em; }

.icon * { stroke-width: 1 } /* N.B. specific to icon used. */
.icon { width: 1.1em !important; height: 1.1em !important; }

.spinner { visibility: hidden; }
.spinner.spin { visibility: visible; animation: spin 1.5s linear infinite; }
@keyframes spin { 100% { transform: rotate(360deg)}; }

.vz-input { display:flex; align-items: center; gap:1ex; }

.download { text-decoration: none; color: inherit; }
